import React from "react";

function Header(props) {
  let Standings = props.standings;
  let Ruler = props.ruler;
  let standings = (
    <div id="active">
      <Standings className="logo" />
    </div>
  );
  let ruler = (
    <div id="active" onClick={props.switch}>
      <Ruler className="logo" />;
    </div>
  );

  return (
    <div className="navBar">
      {/* {standings} */}
      <img src={props.logo} className="logo" alt="csgo_logo"></img>
      {ruler}
    </div>
  );
}

export default Header;
